        {title:'Projects',path: '/projects'},
        {title:'Contact',path: '/contact'},
      ],
      home: {
        title: 'Hi! I\'m Sarah.',
        subTitle: 'Projects',
        text: 'Take a look at my projects'
      },
      about: {
        title: 'About Me',

      },
      home: {
        title: 'Let\'s Connect!',

      },

    }
  }
  render() {
    return (
      <Router>
        <Container className="p-0" fluid={true}>
          <Navbar classname="border-bottom">
            <Navbar.Brand>Sarah Cox-Barkley</Navbar.Brand>
          </Navbar>
        </Container>
      </Router>
    );
  }
}

export default App;
